        if num % 25 == 0:
            return True
        return False

    def swap_adjacent_digits(num: int, i: int) -> int:
        num_str = str(num)
        if i < len(num_str) - 1:
            num_str = num_str[:i] + num_str[i + 1] + num_str[i] + num_str[i + 2:]
        else:
            num_str = num_str[:i] + num_str[i + 1] + num_str[i]
        return int(num_str)

    def min_moves(num: int) -> int:
        if num < 1 or num > 10**18:
            return -1

        moves = 0
        while not is_divisible_by_25(num):
            for i in range(len(str(num)) - 1):
                swapped_num = swap_adjacent_digits(num, i)
                if is_divisible_by_25(swapped_num):
                    num = swapped_num
                    moves += 1
                    break
            else:
                return -1

        return moves

    return min_moves(n)

