        def backtrack(row):
            if row == n:
                return True

            for col in range(n):
                if col in used:
                    continue

                matrix[row][col] = numbers[row * n + col]
                used.add(col)

                if backtrack(row + 1):
                    return True

                used.remove(col)
                matrix[row][col] = 0

            return False

        if backtrack(0):
            return matrix
        else:
            return None

