    def compress_grid(grid: List[List[str]]) -> List[List[str]]:
        def is_full_row(row: List[str]) -> bool:
            return all(cell == "." for cell in row)

        def is_full_column(grid: List[List[str]], col_idx: int) -> bool:
            return all(row[col_idx] == "." for row in grid)

        while any(is_full_row(row) for row in grid) or any(is_full_column(grid, i) for i in range(len(grid[0]))):
            for i, row in enumerate(grid):
                if is_full_row(row):
                    grid.pop(i)
                    break
            else:
                for i in range(len(grid[0])):
                    if is_full_column(grid, i):
                        for row in grid:
                            row.pop(i)
                        break
        return grid

    H, W = map(int, stdin.split()[0:2])
    grid = [list(stdin.split()[i]) for i in range(2, H + 2)]
    compressed_grid = compress_grid(grid)
    return "\n".join("".join(row) for row in compressed_grid)

