    n, m = map(int, stdin.split()[:2])
    edges = []
    for i in range(m):
        v, u = map(int, stdin.split()[2 + 2 * i:4 + 2 * i])
        edges.append((v, u))

    components = []
    visited = [False] * (n + 1)

    def dfs(node, component):
        visited[node] = True
        component.append(node)
        for neighbor in [u for v, u in edges if v == node and not visited[u]]:
            dfs(neighbor, component)

    for i in range(1, n + 1):
        if not visited[i]:
            component = []
            dfs(i, component)
            components.append(component)

    cycle_components = 0
    for component in components:
        if len(component) > 2:
            edges_set = set()
            for i in range(len(component)):
                for j in range(i + 1, len(component)):
                    if (component[i], component[j]) in edges or (component[j], component[i]) in edges:
                        edges_set.add((min(component[i], component[j]), max(component[i], component[j])))
            if len(edges_set) == len(component):
                cycle_components += 1

    return str(cycle_components)

