        color = 'RGB'[idx]

        prev = s[-1]
        res = []
        for i in range(-2, -n - 1, -1):
            if dp[i][idx] == dp[i + 1][idx]:
                res.append(prev)
            else:
                res.append(color)
                prev = color
            color = 'RGB'[(idx + 1) % 3]
            idx = (idx + 1) % 3

        return ans, ''.join(res[::-1])

