        else:
            a, b = map(int, line.split())
            routes.append((a, b))

    # Initialize the adjacency matrix and the distance matrix
    adj_matrix = [[float('inf') for _ in range(n)] for _ in range(n)]
    dist_matrix = [[0 for _ in range(n)] for _ in range(n)]
    for i in range(n):
        adj_matrix[i][i] = 0
        for j in range(i + 1, n):
            adj_matrix[i][j] = adj_matrix[j][i] = float('inf')

    # Floyd-Warshall algorithm to find the shortest path between any two vertices
    for x, y, w in roads:
        adj_matrix[x - 1][y - 1] = adj_matrix[y - 1][x - 1] = w
    for i in range(n):
        for j in range(n):
            for k in range(n):
                dist_matrix[j][k] = min(dist_matrix[j][k], dist_matrix[j][i] + dist_matrix[i][k])

    # Calculate the minimum total cost of the courier routes
    min_cost = float('inf')
    for a, b in routes:
        min_cost = min(min_cost, dist_matrix[a - 1][b - 1])

    # Output the result
    return str(min_cost)

