                    a[i] = 1
                    a[i - 1] = 0
                moves += gap_end - gap_start + 1
            elif gap_end < len(a) - 1 and a[gap_end + 1] == 0:
                for i in range(gap_start, gap_end + 1):
                    a[i] = 1
                    a[i + 1] = 0
                moves += gap_end - gap_start + 1
        return moves

