            if prefix_sums[i - 1] % 2 == 1:
                for subsplit in find_valid_splits(a[i:], k - 1, prefix_sums[i:], dp):
                    dp[k][len(a)] = dp[k][len(a)] + [[i + subsplit[0]] + subsplit]

        return dp[k][len(a)]

