    t, n, m = map(int, stdin.split('\n')[0].split())
    grid = []
    for i in range(n):
        grid.append(list(stdin.split('\n')[i+1]))

    def is_safe(x: int, y: int) -> bool:
        if 0 <= x < n and 0 <= y < m and grid[x][y] != '1':
            return True
        return False

    def bfs(start_x: int, start_y: int, end_x: int, end_y: int) -> int:
        visited = [[False for _ in range(m)] for _ in range(n)]
        visited[start_x][start_y] = True
        queue = [(start_x, start_y, 0)]

        while queue:
            x, y, distance = queue.pop(0)
            if x == end_x and y == end_y:
                return distance

            for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                next_x, next_y = x + dx, y + dy
                if is_safe(next_x, next_y) and not visited[next_x][next_y]:
                    visited[next_x][next_y] = True
                    queue.append((next_x, next_y, distance + 1))

        return -1

    start_x, start_y = None, None
    for i in range(n):
        for j in range(m):
            if grid[i][j] == 'S':
                start_x, start_y = i, j
                break

    if start_x is None or start_y is None:
        return "NOT POSSIBLE"

    result = bfs(start_x, start_y, 0, 0)
    return str(result) if result != -1 else "NOT POSSIBLE"

