    n, q = map(int, lines[0].split())
    lines = lines[1:]

    # Initialize the Union-Find data structure
    parent = list(range(n + 1))
    rank = [0] * (n + 1)

    # Helper function to find the root of a group
    def find(x):
        if parent[x] != x:
            parent[x] = find(parent[x])
        return parent[x]

    # Helper function to merge two groups
    def merge(x, y):
        root_x = find(x)
        root_y = find(y)
        if root_x == root_y:
            return False
        if rank[root_x] > rank[root_y]:
            parent[root_y] = root_x
        else:
            parent[root_x] = root_y
            if rank[root_x] == rank[root_y]:
                rank[root_y] += 1
        return True

    # Process the queries
    sizes = {}
    result = []
    for line in lines:
        query, *args = line.split()
        args = list(map(int, args))
        if query == 't':
            a, b = args
            merge(a, b)
        else:
            a = args[0]
            root = find(a)
            if root in sizes:
                size = sizes[root]
            else:
                size = 0
                group = set()
                for i in range(1, n + 1):
                    if find(i) == root:
                        size += 1
                        group.add(i)
                sizes[root] = size
            result.append(size)

    # Return the result
    return '\n'.join(map(str, result))

