def solution(stdin: str) -> str:
    # Parse the input
    N, board = int(stdin.split('\n')[0]), list(map(list, stdin.split('\n')[1:]))

    # Find the initial position of the knight (K)
    init_pos = None
    for i in range(N):
        for j in range(N):
            if board[i][j] == 'K':
                init_pos = (i, j)
                break
        if init_pos:
            break

    # BFS to find the minimum number of steps
    from collections import deque
    queue = deque([(init_pos, 0)])
    visited = set()
    while queue:
        pos, steps = queue.popleft()
        if pos == (0, 0):
            return str(steps)
        if pos in visited:
            continue
        visited.add(pos)
        r, c = pos
        for dr, dc in [(-2, 1), (-2, -1), (2, 1), (2, -1), (-1, 2), (-1, -2), (1, 2), (1, -2)]:
            new_pos = (r + dr, c + dc)
            if 0 < new_pos[0] <= N and 0 < new_pos[1] <= N and board[new_pos[0]-1][new_pos[1]-1] != '#':
                queue.append((new_pos, steps+1))
    return '-1'

