def solution(stdin: str) -> str:
    def create_encryption_key(key_phrase: str) -> List[str]:
        key = "ABCDEFGHIJKLMNOPQRSTUVWXYZ"
        key = key.replace("Q", "")
        key_phrase = key_phrase.replace(" ", "")
        key_phrase = "".join(sorted(set(key_phrase), key=key_phrase.index))
        encryption_key = list(key_phrase[:5])
        for char in key:
            if char not in encryption_key:
                encryption_key.append(char)
        return encryption_key

    def encrypt(plaintext: str, encryption_key: List[str]) -> str:
        plaintext = plaintext.replace(" ", "")
        plaintext = plaintext.upper()
        ciphertext = ""
        digraphs = [plaintext[i : i + 2] for i in range(0, len(plaintext), 2)]

        for digraph in digraphs:
            if digraph[0] == digraph[1]:
                digraph = digraph[0] + "X"

            row1, col1 = get_position(digraph[0], encryption_key)
            row2, col2 = get_position(digraph[1], encryption_key)

            if row1 == row2:
                ciphertext += encryption_key[row1][(col1 + 1) % 5]
                ciphertext += encryption_key[row2][(col2 + 1) % 5]
            elif col1 == col2:
                ciphertext += encryption_key[(row1 + 1) % 5][col1]
                ciphertext += encryption_key[(row2 + 1) % 5][col2]
            else:
                ciphertext += encryption_key[row1][col2]
                ciphertext += encryption_key[row2][col1]

        return ciphertext

    def get_position(char: str, encryption_key: List[str]) -> Tuple[int, int]:
        for i, row in enumerate(encryption_key):
            if char in row:
                return i, row.index(char)

    key_phrase, plaintext = stdin.split("\n")
    encryption_key = create_encryption_key(key_phrase)
    ciphertext = encrypt(plaintext, encryption_key)
    return ciphertext

