def solution(stdin: str) -> str:
    def process_buy(x, y):
        shares += x
        cost += x * y

    def process_sell(x, y):
        profit = (y - cost // shares) * x
        tax = profit * 0.3
        profit -= tax
        profit_sum += profit
        shares -= x
        cost -= x * y

    def process_split(x):
        shares *= x
        cost //= x

    def process_merge(x):
        shares -= shares % x
        shares //= x
        cost *= x

    lines = stdin.split('\n')
    shares = 0
    cost = 0
    profit_sum = 0

    for line in lines:
        tokens = line.split()
        if tokens[0] == 'buy':
            process_buy(int(tokens[1]), int(tokens[2]))
        elif tokens[0] == 'sell':
            process_sell(int(tokens[1]), int(tokens[2]))
        elif tokens[0] == 'split':
            process_split(int(tokens[1]))
        elif tokens[0] == 'merge':
            process_merge(int(tokens[1]))
        elif tokens[0] == 'die':
            process_sell(shares, int(tokens[1]))

    return f"{profit_sum:.2f}"

